import './App.css';
import { BrowserRouter, Router, Route, Switch} from 'react-router-dom';
import home from './components/Pages/home';



function App() {

  return (
    <div className="App">
        <Switch>
            <Route exact path="/" component={home} />
        </Switch>
    </div>
  );

}

export default App;
